css:
.github-StubItem-github,
.github-GitHub-root {
  flex: 1;
  display: flex;
}
.github-GitHub {
  flex: 1;
  min-width: 0;
  display: flex;
  flex-direction: column;
}
.github-GitHub-content {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-GitHub-noRemotes {
  margin: 10px;
  font-size: 16.25px;
}
.github-GitHub .github-RemoteSelector {
  font-size: 16.25px;
}
.github-GitHub .github-RemoteSelector p {
  text-align: center;
  margin: 10px;
}
.github-GitHub .github-RemoteSelector ul {
  list-style: none;
  padding-left: 1em;
}
.github-GitHub .github-RemoteSelector button {
  margin-bottom: 10px;
}
